import { CgProfile } from "react-icons/cg";
import "./Nav.css";
import { useState } from "react";

const Nav = () => {
  const [outModal, setOutModal] = useState(false);
  return (
    <div className="nav-container">
      <h1>Kite</h1>
      <div className="nav-right">
        <button className="btn">Add a spot</button>
        <a>
          <CgProfile />
        </a>
      </div>
    </div>
  );
};

export default Nav;
